import React, {Component} from 'react';

class Review extends Component {
  render() {
    return (
      <div className="Review">
      <a href='http://highoncoding.com/Articles/880_Hello_WatchKit.aspx'> <h2 className='ReviewTitle'>{this.props.title}</h2>
      <p>{this.props.body}</p>
      <p className='ReviewCommentsAndLikes'>{this.props.comments} comments {this.props.likes} likes</p>
      </a>
      </div>
    )
  }
}

export default Review
